pragma solidity >=0.5.0 <0.9.0;

contract AppointmentBooking {
    struct Appointment {
        address patient;
        uint256 date;
        bool booked;
    }

    Appointment[] public appointments;

    function bookAppointment(uint256 date) public payable {
        require(msg.value == 1 ether, "Payment of 1 ether is required for booking an appointment.");
        require(date > block.timestamp, "Appointment date must be in the future.");
        
        Appointment memory newAppointment = Appointment({
            patient: msg.sender,
            date: date,
            booked: true
        });
        
        appointments.push(newAppointment);
    }

    function getAvailableAppointments() public view returns (uint256[] memory) {
        uint256[] memory availableAppointments = new uint256[](appointments.length);
        uint256 count = 0;
        
        for (uint256 i = 0; i < appointments.length; i++) {
            if (!appointments[i].booked && appointments[i].date > block.timestamp) {
                availableAppointments[count] = appointments[i].date;
                count++;
            }
        }
        
        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = availableAppointments[i];
        }
        
        return result;
    }
}
